.blockquote-wrapper {
    position: relative;
    border-top: 1px solid #eee;
    border-bottom: 1px solid #eee;
}

blockquote {
    margin: 0;
    transition: opacity 300ms;
}

q {
    quotes: "\201C" "\201D" "\2018" "\2019";
}

.blockquote-wrapper svg {
    background: #8DCDB1;
    position: absolute;
    height: 20px;
    width: 20px;
    padding: 12px;
    border-radius: 100%;
    left: 50%;
    top: -26px;
    fill: #fff;
    /* border: 1px solid #d9d9d9; */
}

.home {
    background-color: rgba(163, 214, 192, 0.1);
    color: #666;
    position: relative;
}

.home::before {
    background-image: url(dbac9baf167acd9c124d94df7601e089.png);
    content: "";
    display: block;
    position: absolute;
    height: 100%;
    width: 100%;
    top: 0;
    left: 0;
    z-index: -1;
}

.section-stripe {
    background-color: #F6FBFC;
}

.section-icon-wrapper {
    border: 2px solid #ddd;
    border-radius: 100%;
    padding: 15px;
    width: 60px;
    height: 60px;
}

.section-icon {
    width: 100%;
    height: 100%;
    fill: #ddd;
}

header {
    transition: box-shadow 200ms ease-in;
}

.sticky header {
    position: fixed;
    background: white;
    width: 100%;
    box-shadow: 0 0 6px 0 rgba(0, 0, 0, 0.24);
    z-index: 1;
}

